import React, { Component } from "react";

import "../index.css";
import MenuBarComponent from "./menuBarComponent";

class MenuBar extends React.Component {
  render() {
    return (
      <div>
        <MenuBarComponent
          text="Neues Fach"
          barClicked={this.props.barClicked}
          id="topic"
        />
        <MenuBarComponent
          text="Neue Frage"
          barClicked={this.props.barClicked}
          id="question"
        />
      </div>
    );
  }
}

export default MenuBar;
